def main():
    a = list(map(int, input().split()))
    dp = [[0 for _ in range(len(a) + 1)] for _ in range(max(a) + 1)]
    for i in range(len(a)):
        for j in range(1, max(a) + 1):
            dp[j][i + 1] = dp[j][i]
            if j >= a[i]:
                dp[j][i + 1] = max(dp[j][i + 1], dp[j - a[i]][i] + 1)
    print(max(dp[max(a)]))
    return 0


